#include <iostream>
#include <fstream>
#include <string>
using namespace std;

class Solution {
public:
    int firstUniqChar(string s) {
        int arr[256];
        for ( int i = 0; i < 256; i++ ){
            arr[i] = 0;
        }
        for ( int i = 0; i < s.size(); i++){
            arr[s[i]]++;
        }
        int pos = -1;
        for ( int i = 0; i < s.size(); i++){
            if ( arr[s[i]] == 1 ){
                pos = i;
                i = s.size();
                // return i;
            }
        }        
        ofstream myfile;
        myfile.open ("output.txt");
        for ( int i = 0; i < 256; i++){
            myfile << "i = " << (char)i << " " << (int)arr[i] << endl;
        }
        myfile.close();
        return pos;
        
    }
};

int main(){
    Solution s;
    string testCases[] = {
        "leetcode",
        "loveleetcode",
        "abcde",
        "abcdefa",
        "aaaaaaa",
        ""
    };

    for ( string testCase: testCases ){
        cout << s.firstUniqChar(testCase) << endl; 
    }
}